import React, { Component } from "react";
import { Button, Input, Container, Grid, CardMedia } from "@material-ui/core";
import Logo from "./Logo";

class Header extends Component {
  render() {
    return (
      <div>
        <Grid justify="flex-start" direction="column" color="primary">
          <CardMedia src={Logo} color="red"></CardMedia>
          <Button>Home</Button>
          <Button>Contact</Button>
          <Button>About</Button>
          <Button>Login</Button>
          <Button>Register</Button>
        </Grid>
        <Container>
          <Button variant="contained" color="primary">
            Hello World
          </Button>
          <Input fullWidth="true" />
        </Container>
      </div>
    );
  }
}

export default Header;
